import React, { Component } from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.css';

class Top extends Component{

    constructor(props){
        super(props);

        this.state = {
            title: 'My portfolio'
        }
    }

    render(){
        return(
            <div>
                <div class="row">
                    <div class="col-3"></div>
                    <div class="col-6 padding-content"><h2>{ this.state.title }</h2></div>
                    <div class="col-3"></div>
                </div>
            </div>
        );
    }
}

export default Top;
